import React from 'react';

const Form = (props) => {
	return (
		<form id='book-form'>
			<div class='input-group mb-3'>
				<input
					type='text'
					id='city'
					class='form-control'
					placeholder='Enter City...'
					aria-label="Recipient's username"
					aria-describedby='basic-addon2'
				/>
				<button
					type='submit'
					id='w-change-btn'
					class='btn btn-outline-secondary input-group-append'
				>
					Find
				</button>
			</div>
		</form>
	);
};

export default Form;
